function substrCount(n, s) {
  let answer = n;

  let same = { char: null, before: 0, after: 0 };
  let middle = { char: null, index: null };
  let isLast = false;

  for (let i = 0; i < s.length; ) {
    if (same.char === null) same.char = s[i];
    if (i === s.length - 1) isLast = true;

    if (same.char === s[i]) {
      middle.char ? same.after++ : same.before++;
      i++;
      if (!isLast) continue;
    }

    if (!middle.char) {
      middle.char = s[i];
      middle.index = i;
      i++;
      if (!isLast) continue;
    }

    // console.log(`before: ${same.char.repeat(same.before)} / middle: ${middle.char} / after: ${same.char.repeat(same.after)}`);
    answer += sum(same.before);
    if (same.before && same.after) answer += same.before > same.after ? same.after : same.before;
    if (isLast) {
      answer += sum(same.after);
      if (same.after === 0 && middle.char && middle.char === s[i]) answer++;
      if (same.after === 1 && middle.char && middle.char === s[i]) answer++;
      i++;
      continue;
    }

    i = middle.index;
    same = { char: null, before: 0, after: 0 };
    middle = { char: null, index: null };
  }

  return answer;
}

const sum = (n) => {
  if (n === 1 || n === 0) return 0;
  return (n * (n - 1)) / 2;
};

